import logo from './logo.svg';
import './App.css';
import MovieItem from './components/MovieItem/MovieItem';
import movies from './data';




function App() {
  return (
    <div className="App">
      {movies.map((movie, index) => {
        return (
          <MovieItem key={index} title={movie.title} year={movie.year} author={movie.director} lenght={movie.duration} rating={movie.rate} genre={movie.genre} />
        );
      })}
    </div>
  );
}

export default App;
